import React, { Component } from "react";
import axios from "axios";
// import ImageList from "./ImageList";

const API_KEY = "5f0ca9ae5c0961037501f34373524d33";

class Api extends Component {
  state = {
    pictures: []
  };

  componentDidMount() {
    this.serverRequest = axios
      .get(
        `https://api.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=${API_KEY}&tags=dogs&per_page=10&format=json&nojsoncallback=1`
      )
      .then(results => {
        this.setState({
          items: results.data.people.getinfo
        });
      });

    fetch(
      `https://api.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=${API_KEY}&tags=dogs&per_page=10&format=json&nojsoncallback=1`
    )
      .then(function(response) {
        return response.json();
      })
      .then(
        function(j) {
          let picArray = j.photos.photo.map(pic => {
            var srcPath =
              "https://farm" +
              pic.farm +
              ".staticflickr.com/" +
              pic.server +
              "/" +
              pic.id +
              "_" +
              pic.secret +
              ".jpg";
            return <img alt="dogs" src={srcPath} />;
          });
          this.setState({ pictures: picArray });
        }.bind(this)
      );
  }

  render() {
    return (
      <div>
        {this.state.pictures}
        {/* <ImageList images={this.state.images} /> */}
      </div>
    );
  }
}

export default Api;
